import React from "react";
import './Intro.css';

export default () => {
  return (
    <div className="component first-component">
      <div className="contentIntro">
        <h1>Welcome</h1>
        <p>
          This website was created to show my skills, both as a back end and a front end developer. All features on this website were implemented by me using ReactJS. This website contains a list of 
          my previous jobs and volunteer positions. It also contains a list of references. If you would like contact details for them, please consult a physical copy of my resume or please get in
          touch with me. You will also find details relating to my current and past projects.
        </p>
      </div>
    </div>
  );
};
